import React, { Component } from 'react';
import TripOrdersService from '../service/travel-order-service';

import { Link } from 'react-router-dom';

import Navbar from '../Navbar/Navbar';


import "./triporders.scss";


export default class TripOrders extends Component {

  constructor(props){
    super(props);
    this.state = { travels: [], orders: []};
    this.service = new TripOrdersService();
  }

  componentDidMount(){
    this.service.getAllOrdersfromTravels()
    .then(alltravelorders => {
      this.setState({...this.state,
        alltravelorders: alltravelorders
      })
      this.props.getAllOrdersfromTravels(alltravelorders) //getUser
    }).catch(err => {
      console.log(err)
      } )
  }

  render() {
    return (
      <div>

      <Navbar conditions={'trips'}/>




  {this.state.travels.map(travel => {
  return(
    <div >
    <p >{travel._id}</p>
    <h2>{travel.travelFrom}</h2>
    <h2>{travel.travelTo}</h2>
    <p>Travel Date: {travel.travelDate}</p>

    <input id="relatedOrders-button" type="submit" value="Related orders" onClick={e => this.tripsOrdersRelated(travel._id)}/>
    <input id="tripDelete-button" type="submit" value="Cancel Trip"/>


    </div>


  )
} )
}









      </div>
    )
  }
}
